          { locale: 'th', name: '' },
        ],
      },
    },
  })

  const silom = await prisma.area.create({
    data: {
      slug: 'silom',
      translations: {
        create: [
          { locale: 'ja', name: '' },
          { locale: 'en', name: 'Silom' },
          { locale: 'th', name: '' },
        ],
      },
    },
  })

  console.log(' Areas created')

  // Create Categories
  const restaurant = await prisma.category.create({
    data: {
      slug: 'restaurant',
      translations: {
        create: [
          { locale: 'ja', name: '' },
          { locale: 'en', name: 'Restaurant' },
          { locale: 'th', name: '' },
        ],
      },
    },
  })

  const cafe = await prisma.category.create({
    data: {
      slug: 'cafe',
      translations: {
        create: [
          { locale: 'ja', name: '' },
          { locale: 'en', name: 'Cafe' },
          { locale: 'th', name: '' },
        ],
      },
    },
  })

  console.log(' Categories created')

  // Create Tags
  const japanese = await prisma.tag.create({
    data: {
      slug: 'japanese-food',
      translations: {
        create: [
          { locale: 'ja', name: '' },
          { locale: 'en', name: 'Japanese Food' },
          { locale: 'th', name: '' },
        ],
      },
    },
  })

  const wifi = await prisma.tag.create({
    data: {
      slug: 'free-wifi',
      translations: {
        create: [
          { locale: 'ja', name: 'WiFi' },
          { locale: 'en', name: 'Free WiFi' },
          { locale: 'th', name: 'WiFi ' },
        ],
      },
    },
  })

  console.log(' Tags created')

  // Create Sample Place
  await prisma.place.create({
    data: {
      slug: 'sample-japanese-restaurant',
      status: 'PUBLISHED',
      areaId: sukhumvit.id,
      categoryId: restaurant.id,
      priceRange: 3,
      phone: '+66-2-123-4567',
      address: '123 Sukhumvit Road, Bangkok',
      latitude: 13.7563,
      longitude: 100.5018,
      featured: true,
      translations: {
        create: [
          {
            locale: 'ja',
            name: '',
            description: '',
          },
          {
            locale: 'en',
            name: 'Sample Japanese Restaurant',
            description: 'Authentic Japanese cuisine in Bangkok.',
          },
          {
            locale: 'th',
            name: '',
            description: '',
          },
        ],
      },
      tags: {
        create: [{ tagId: japanese.id }, { tagId: wifi.id }],
      },
    },
  })

  console.log(' Sample place created')

  // Create Sample Article
  await prisma.article.create({
    data: {
      slug: 'welcome-to-bangkok',
      type: 'GUIDE',
      published: true,
      featured: true,
      publishedAt: new Date(),
      translations: {
        create: [
          {
            locale: 'ja',
            title: '',
            content: '',
            excerpt: '',
          },
          {
            locale: 'en',
            title: 'Welcome to Bangkok',
            content: 'A guide to starting your life in Bangkok.',
            excerpt: 'Bangkok living guide',
          },
          {
            locale: 'th',
            title: '',
            content: '',
            excerpt: '',
          },
        ],
      },
    },
  })

  console.log(' Sample article created')

  console.log(' Seeding completed!')
}

main()
  .catch((e) => {
    console.error(' Error:', e)
    process.exit(1)
  })
  .finally(async () => {
    await prisma.$disconnect()
  })

